import Head from "next/head";
function Layout(props) {
  return (
    <div className="layout">
      <CustomHead />
      
    </div>
  );
}
export default Layout;
//Setting page head
function CustomHead() {
  return (
    <Head>
      <title>Covid Anchor</title>
      <link rel="stylesheet" href="/css/global.css" />
    </Head>
  );
}
